    return (
        <Router>
            <Routes>
                <Route path="/" element={<HomePage />} />
                {/* <Route path="/locations" element={<LocationListPage />} />
                <Route path="/locations/:id" element={<LocationDetailPage />} />
                <Route path="/plan" element={<PlanPage />} /> */}
            </Routes>
        </Router>
    );
};

export default AppRouter;
